import React, { useState } from 'react';
import { Link } from 'react-router-dom'; // Import Link from react-router-dom

const Navbar = () => {
  const [isOpen, setIsOpen] = useState(false);

  const toggleMenu = () => {
    setIsOpen(!isOpen);
  };

  return (
    <nav style={styles.navbar}>
      <div style={styles.logo}>
        <Link to="/" style={styles.link}>MySite</Link>
      </div>
      <div style={styles.hamburger} onClick={toggleMenu}>
        <div style={styles.line}></div>
        <div style={styles.line}></div>
        <div style={styles.line}></div>
      </div>
      <ul style={{ ...styles.navList, display: isOpen ? 'flex' : 'none' }}>
        <li style={styles.navItem}>
          <Link to="/" style={styles.link}>Home</Link>
        </li>
        <li style={styles.navItem}>
          <Link to="/about" style={styles.link}>About Us</Link>
        </li>
        <li style={styles.navItem}>
          <Link to="/contact" style={styles.link}>Contact</Link>
        </li>
        <li style={styles.navItem}>
          <Link to="/dashboard" style={styles.link}>COVID-Dashboard</Link>
        </li>
      </ul>
    </nav>
  );
};

const styles = {
  navbar: {
    background: "green",
    padding: "15px",
    display: "flex",
    alignItems: "center",
    justifyContent: "space-between",
  },
  logo: {
    fontSize: "24px",
    color: "#fff",
  },
  hamburger: {
    display: "none",
    flexDirection: "column",
    cursor: "pointer",
  },
  line: {
    width: "25px",
    height: "3px",
    backgroundColor: "#fff",
    margin: "4px 0",
  },
  navList: {
    display: "flex",
    listStyle: "none",
    margin: 0,
    padding: 0,
  },
  navItem: {
    marginLeft: "20px",
  },
  link: {
    color: "#fff",
    textDecoration: "none",
    fontSize: "20px",
  },

  /* Responsive Styles */
  '@media (max-width: 768px)': {
    hamburger: {
      display: "flex",
    },
    navList: {
      flexDirection: "column",
      position: "absolute",
      top: "60px",
      right: 0,
      backgroundColor: "green",
      width: "100%",
      alignItems: "center",
      padding: "10px 0",
      display: "none", // Default to hidden, controlled by state
    },
    navItem: {
      margin: "10px 0",
    },
  },
};

export default Navbar;
